import React, { useState } from "react";
import {
  TextField,
  Grid,
  Typography,
  Divider,
  ListItem,
  ListItemText,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  Button,
} from "@material-ui/core";
import Wheel from "./wheel";
import Card from "./card";
import { recipes } from "../../constants/recipes";

const OverviewDialog = (props) => {
  const {
    dialogState = {},
    handleDialog,
    showAnswer,
    setShowSpin,
    setShowAnswer,
    showSpin,
    handlePlayerItems,
    player1Items,
    player2Items,
    player1,
    player2,
  } = props;
  return (
    <Dialog
      fullWidth
      open={dialogState.open}
      onClose={() => {
        handleDialog({ open: false });
        setShowAnswer(false);
        setShowSpin(false);
      }}
      aria-labelledby="max-width-dialog-title"
      maxWidth="md"
    >
      <DialogTitle id="max-width-dialog-title">Status</DialogTitle>
      <DialogContent style={{ height: 400 }}>
        <Grid
          container
          spacing={2}
          direction="row"
          justifyContent="space-around"
          style={{ height: 250 }}
        >
          <Grid item sm={12} md={6} style={{ textAlign: "center" }}>
            <DialogContentText>
              <Typography variant="body1">
                {player1 || "Player 1"} - {player1Items.length} items
              </Typography>
            </DialogContentText>
            <Grid container spacing={2}>
              {player1Items.map((item, i) => {
                const { option } = item;
                return <Grid item>{option}</Grid>;
              })}
            </Grid>
          </Grid>
          {/* <Grid item> */}
          <Divider
            orientation="vertical"
            style={{ height: 200, color: "black", opacity: 1, marginRight: -1 }}
          />
          {/* </Grid> */}
          <Grid item sm={12} md={6} style={{ textAlign: "center" }}>
            <DialogContentText>
              <Typography variant="body1">
                {player2 || "Player 2"} - {player2Items.length} items
              </Typography>
            </DialogContentText>
            <Grid container spacing={2}>
              {player2Items.map((item, i) => {
                const { option } = item;
                return <Grid item>{option}</Grid>;
              })}
            </Grid>
          </Grid>
        </Grid>

        <Grid container spacing={2}>
          {recipes.map((recipe, i) => {
            const { name, uri, ingredients } = recipe;
            console.log("ðŸš€ ~ {recipes.map ~ ingredients:", ingredients);
            const checker = (arr, target) =>
              target.every((v) => arr.includes(v));
            const canPlayer1Have = player1Items.length
              ? checker(ingredients, player1Items)
              : false;
            const canPlayer2Have = player2Items.length
              ? checker(ingredients, player2Items)
              : false;
            return (
              <Grid item key={i} xs={12} sm={6} md={3}>
                <Card
                  name={name}
                  uri={uri}
                  ingredients={ingredients}
                  canPlayer1Have={canPlayer1Have}
                  canPlayer2Have={canPlayer2Have}
                />
              </Grid>
            );
          })}
        </Grid>
      </DialogContent>
      <DialogActions>
        <Button
          onClick={() => {
            handleDialog({ open: false });
            setShowAnswer(false);
            setShowSpin(false);
          }}
          color="primary"
        >
          Close
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default OverviewDialog;
